def enc(s):
    out = 0
    for c in s:
        out = out * 128 + ord(c)
    return out

def dec(n):
    out = __import__('collections').deque()
    while n > 0:
        n, c = divmod(n, 128)
        out.appendleft(chr(c))
    return ''.join(out)

s = dec()

exec(s)
